import React, { useState } from 'react';

const SurgeryForm = () => {
  // Initialize state for each column (Days 1-90) and form fields
  const [data, setData] = useState({
    date_Procedure: '',
    postOpDay: '',
    day1: '',
    day2: '',
    day3: '',
    day4: '',
    day5: '',
    day6: '',
    day7: '',
    day8: '',
    day9: '',
    day10: '',
    day11: '',
    day12: '',
    day13: '',
    day14: '',
    day15: '',
    day16_30: '',
    day31_60: '',
    day60_90: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setData({ ...data, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(data);
  };

  return (
    <div style={{ width: '100%', margin: '0 auto', backgroundColor: '#f4f4f4', padding: '20px', borderRadius: '8px' }}>
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column' }}>
        <h2>Surgery Procedure Form</h2>

        <table style={{ width: '100%', borderCollapse: 'collapse', textAlign: 'center' }}>
          <thead>
            <tr>
              <th style={tableHeaderStyle}>Name of Procedure</th>
              <th style={tableHeaderStyle}>1</th>
              <th style={tableHeaderStyle}>2</th>
              <th style={tableHeaderStyle}>3</th>
              <th style={tableHeaderStyle}>4</th>
              <th style={tableHeaderStyle}>5</th>
              <th style={tableHeaderStyle}>6</th>
              <th style={tableHeaderStyle}>7</th>
              <th style={tableHeaderStyle}>8</th>
              <th style={tableHeaderStyle}>9</th>
              <th style={tableHeaderStyle}>10</th>
              <th style={tableHeaderStyle}>11</th>
              <th style={tableHeaderStyle}>12</th>
              <th style={tableHeaderStyle}>13</th>
              <th style={tableHeaderStyle}>14</th>
              <th style={tableHeaderStyle}>15</th>
              <th style={tableHeaderStyle}>16-30</th>
              <th style={tableHeaderStyle}>31-60</th>
              <th style={tableHeaderStyle}>60-90</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td style={tableCellStyle}>Purulent Discharge</td>
              <td style={tableCellStyle}><input type="text" name="day1" value={data.day1} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day2" value={data.day2} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day3" value={data.day3} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day4" value={data.day4} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day5" value={data.day5} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day6" value={data.day6} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day7" value={data.day7} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day8" value={data.day8} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day9" value={data.day9} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day10" value={data.day10} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day11" value={data.day11} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day12" value={data.day12} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day13" value={data.day13} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day14" value={data.day14} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day15" value={data.day15} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day16_30" value={data.day16_30} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day31_60" value={data.day31_60} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="day60_90" value={data.day60_90} onChange={handleChange} style={inputStyle} /></td>
            </tr>

            {/* Add more rows as necessary for each form field */}
            {/* Example for "Localized Pain" */}
            <tr>
              <td style={tableCellStyle}>Localized Pain</td>
              <td style={tableCellStyle}><input type="text" name="localized_day1" value={data.localized_day1} onChange={handleChange} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" name="localized_day2" value={data.localized_day2} onChange={handleChange} style={inputStyle} /></td>
